import{_ as e}from"./chunks/LinkingClientsInIntegration.Ba_e2NPc.js";import{_ as o,c as a,ah as i,o as r}from"./chunks/framework.BWXOFiC5.js";const s="/assets/2021-03-23-16-14-24.DlHyhlev.png",n="/assets/2021-03-23-16-19-01.Dj_tWZLO.png",l="/assets/2021-03-23-16-30-41.YkbGnvJ4.png",m="/assets/2021-03-23-18-35-49.sNjkhiDI.png",u="/assets/2021-03-23-18-35-28.DVBY9oQA.png",c="/assets/2021-03-23-18-39-00.BLBXbXB_.png",g="/assets/CWAutomateIntegrationForm-GoogleMFA.CqwfQZAg.png",w=JSON.parse('{"title":"ConnectWise Automate","description":"","frontmatter":{},"headers":[],"relativePath":"Documentation/Integrations/connectwise-automate-integration-setup.md","filePath":"Documentation/Integrations/connectwise-automate-integration-setup.md"}'),p={name:"Documentation/Integrations/connectwise-automate-integration-setup.md"};function d(h,t,y,f,A,b){return r(),a("div",null,t[0]||(t[0]=[i('<h1 id="connectwise-automate" tabindex="-1">ConnectWise Automate <a class="header-anchor" href="#connectwise-automate" aria-label="Permalink to &quot;ConnectWise Automate&quot;">​</a></h1><p>Setting up this integration allows you to</p><ul><li>Import customers from Automate</li><li>Import computers from Automate</li><li>Manage all computers in Automate without deploying the ImmyBot Agent</li><li>Map customers from Manage to ImmyBot tenant based on existing Automate&lt;-&gt;Manage relationship</li></ul><h2 id="prerequisites" tabindex="-1">Prerequisites <a class="header-anchor" href="#prerequisites" aria-label="Permalink to &quot;Prerequisites&quot;">​</a></h2><ul><li>You must be an administrator in ImmyBot</li><li>You must be able to manage security roles and users in Automate</li><li>You must be able to to manage API keys in Automate</li></ul><h2 id="create-immybot-role" tabindex="-1">Create ImmyBot Role <a class="header-anchor" href="#create-immybot-role" aria-label="Permalink to &quot;Create ImmyBot Role&quot;">​</a></h2><p>ImmyBot requires the following permissions in Automate</p><ol><li>Navigate to <strong>System</strong> &gt; <strong>User Class Manager</strong></li><li>In <strong>User Class Manager</strong>, create a new role and enable the following permissions</li></ol><ul><li>Core <ul><li>Clients.Read</li><li>Clients.Show All</li><li>Computers.Show All</li><li>Computers.Edit (For moving existing computers to new locations)</li><li>Computers.Delete (For retiring duplicate computers)</li><li>Groups.Show All</li><li>Locations.Show All</li><li>Patch Manager.Read (Required if you want Immy to apply approved Windows Updates)</li></ul></li></ul><p><img src="https://user-images.githubusercontent.com/5932122/187803601-f2d49a3a-11cc-46b9-8aa2-b7ea1123902e.png" alt="Immy-CWA-User Class Manager-Permissions"></p><h2 id="create-immybot-user" tabindex="-1">Create ImmyBot User <a class="header-anchor" href="#create-immybot-user" aria-label="Permalink to &quot;Create ImmyBot User&quot;">​</a></h2><ol><li>Navigate to <strong>System</strong> &gt; <strong>Users</strong></li><li>Add a User and add the following information on the General tab <ol><li>Username: ImmyBot</li><li>Password: Something complex and unique</li><li>Email Address: Set this to your own email address</li></ol></li><li>Click on the Permissions tab, right click on the User Classes, and select the ImmyBot Role that you created. <img src="'+s+'" alt=""></li></ol><p><img src="'+n+'" alt=""></p><p><img src="'+l+'" alt=""></p><h2 id="enable-google-mfa-for-immybot-user" tabindex="-1">Enable Google MFA for ImmyBot User <a class="header-anchor" href="#enable-google-mfa-for-immybot-user" aria-label="Permalink to &quot;Enable Google MFA for ImmyBot User&quot;">​</a></h2><p>The integration requires Google for MFA. Duo is not supported as Duo does not expose the MFA token anywhere for us to use and doesn&#39;t appear to be the standard TOTP like Google uses. You will need to exclude the integration user from your Duo deployment if using Duo and configure the Google MFA plugin for Automate for this user.</p><p><img src="'+m+'" alt=""></p><p><img src="'+u+'" alt=""></p><p><img src="'+c+'" alt=""></p><h2 id="add-rmm-link-for-cw-automate" tabindex="-1">Add RMM Link for CW Automate <a class="header-anchor" href="#add-rmm-link-for-cw-automate" aria-label="Permalink to &quot;Add RMM Link for CW Automate&quot;">​</a></h2><ol><li>In ImmyBot, navigate to <strong>Show More</strong> &gt; <strong>Integrations</strong> and click on <strong>Add Integration</strong></li><li>Find and add the <strong>CW Automate</strong> integration</li><li>Edit the integration and fill out the form <ol><li>Automate URL: Your Automate Url (ie <a href="https://automate.mymsp.com" target="_blank" rel="noreferrer">https://automate.mymsp.com</a>)</li><li>Automate Username: the Username you created in the Create ImmyBot user step, should be ImmyBot unless you went with something else</li><li>Automate Password: the password you created in the Create ImmyBot user step</li><li>Manual Entry code: The Google MFA code you got in your email</li></ol></li></ol><p><img src="'+g+'" alt=""></p><h2 id="import-your-customers" tabindex="-1">Import your customers <a class="header-anchor" href="#import-your-customers" aria-label="Permalink to &quot;Import your customers&quot;">​</a></h2><ol><li>From the CW Automate Integration screen click on Clients</li><li>Link your MSP tenant manually first</li><li>You can bulk Create tenants or manually link tenants between ImmyBot and CW Automate <ol><li>Alternativly, ImmyBot will suggest tenants that it thinks are the correct ones to link</li></ol></li></ol><p>Alternatively, you can create/map only certain customers. When you map a customer from an RMM, the computers will undergo Identification</p><p><img src="'+e+'" alt=""></p>',26)]))}const C=o(p,[["render",d]]);export{w as __pageData,C as default};
